const TodoList = (props) => {
    const taches = props.taches;

    return (
        <ul className="list-group">
            {taches.map((tache, index) => <Todo key={index} id={index} tache={tache} onCheck={props.onCheck} />)}
        </ul>
    )
}

export default TodoList;
